total_minima_normb=normalize(total_minima_b,2,"scale");
data = mean(total_minima_normb);
Nd = size(total_minima_normb,1);
SEMd = std(total_minima_normb,0,1) / sqrt(Nd);             % Standard Error Of The Mean

CI95d = SEMd * tinv(0.95, Nd-1);              % 95% Confidence Intervals

errd=CI95d*ones(1);
%errd=[0,normalize(err,"range")];
errhigh = errd/2;
errlow  = -errd/2;
%lightBlue = [91, 207, 244] / 255; 
b=bar(x,data);                
b.FaceColor = "#80B3FF";
b.EdgeColor = 'k';
%plot(b)
hold on

er = errorbar(x,data,errlow,errhigh,'LineWidth',1.5);    
er.Color = [0 0 0];                            
er.LineStyle = 'none'; 
title('\fontsize{17}Average Maximum Relative Impedance Variation')
xlabel('\fontsize{17}Diameter')
